Here's a contract that incorporates the given logic. Note that the complexity of the conditional expressions have been reduced for readability. 

```solidity
pragma solidity ^0.6.12;

contract TestContract {
    mapping(address => string) private tokenURI;
    mapping(address => uint256) private guardiansbytes20;
    uint256 public registrationdepositwei;
    uint256 public registrationmintime;

    function register(string memory firstArg, string memory secondArg) public payable {
        require(msg.value == registrationdepositwei, "Incorrect deposit amount");
        require(bytes(secondArg).length > 0, "Argument length is 0");
        require(keccak256(abi.encodePacked(tokenURI[msg.sender])) != keccak256(abi.encodePacked("")), "Token URI is empty");

        if (bytes(firstArg).length > 0) {
            guardiansbytes20[msg.sender] = uint256(keccak256(abi.encodePacked(firstArg)));
        }

        if (keccak256(abi.encodePacked(tokenURI[msg.sender])) > keccak256(abi.encodePacked(""))) {
            tokenURI[msg.sender] = firstArg;
        }
    }

    function update(string memory firstArg, string memory secondArg) public {
        require(keccak256(abi.encodePacked(tokenURI[msg.sender])) != keccak256(abi.encodePacked("")), "Token URI is empty");
        require(bytes(secondArg).length > 0, "Argument length is 0");

        if (keccak256(abi.encodePacked(tokenURI[msg.sender])) > keccak256(abi.encodePacked(""))) {
            tokenURI[msg.sender] = firstArg;
        }
    }

    function leave() public {
        require(keccak256(abi.encodePacked(tokenURI[msg.sender])) != keccak256(abi.encodePacked("")), "Token URI is empty");
        require(registrationmintime + uint256(keccak256(abi.encodePacked(tokenURI[msg.sender]))) >= uint256(keccak256(abi.encodePacked(tokenURI[msg.sender]))), "Registration time issue");
        require(uint256(keccak256(abi.encodePacked(tokenURI[msg.sender]))) < guardiansbytes20[msg.sender], "Incorrect guardian");
        require((guardiansbytes20[msg.sender] + 0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff) < guardiansbytes20[msg.sender], "Guardian overflow");

        msg.sender.transfer(registrationdepositwei);
        tokenURI[msg.sender] = "";
    }
}
```

This contract provides three functions:

- `register`: Allows a user to register with a deposit. It checks whether the deposit matches the required amount, and whether the second argument length is greater than 0. If the first argument length is greater than 0, it updates the guardiansbytes20 mapping with the converted first argument. It also updates the tokenUri of the sender if certain conditions are met.
- `update`: Allows a user to update their tokenUri. It checks whether the tokenUri of the sender is not empty and whether the second argument length is greater than 0. If certain conditions are met, it updates the tokenUri of the sender.
- `leave`: Allows a user to leave, refunding their deposit. It checks whether the tokenUri of the sender is not empty, whether the registrationmintime plus the converted tokenUri of the sender is not smaller than the converted tokenUri of the sender, whether the converted tokenUri of the sender is smaller than the guardiansbytes20 of the sender, and whether the guardiansbytes20 of the sender plus a large number is smaller than the guardiansbytes20 of the sender. If all checks pass, it transfers the registration deposit back to the sender and sets their tokenUri to an empty string.
